// be executed in the renderer process for that window.
// All of the Node.js APIs are available in this process.
const WebSocket = require('ws');
const btoa = require('btoa');
var wss;
var mockIdCardInfo = {
    NationalID: '',
    ThaiTitleName: '',
    ThaiFirstName: '',
    ThaiLastName: '',
    EnglishFirstName: '',
    EnglishLastName: '',
    Sex: '',
    Address: '',
    Moo: '',
    Trok: '',
    SoiThanon: '',
    Tumbol: '',
    Amphur: '',
    Province: '',
    IssueDate: 'DD-MM-YYYY',
    ExpireDate: 'DD-MM-YYYY',
    Birthdate: 'DD-MM-YYYY',
}
function startWebSocket() {
    wss = new WebSocket.Server({ port: 8088, path: "/ReadIDCard" });
    console.log('startWebSocket');

    wss.on('connection', function connection(ws) {
        ws.on('message', function incoming(message) {
            console.log('received: %s', message);
        });
        ws.on('close', function close() {
            console.log('disconnected');
        });
    });
    document.querySelector('#btnStopWebSocket').removeAttribute('disabled');
    document.querySelector('#btnStartWebSocket').setAttribute('disabled', false);
}

function stopWebSocket() {
    console.log('stopWebSocket');
    wss.close();
    document.querySelector('#btnStartWebSocket').removeAttribute('disabled');
    document.querySelector('#btnStopWebSocket').setAttribute('disabled', false);
}

function onCardInserted() {
    console.log('onCardInserted');
    wss.clients.forEach(function (client) {
        client.send(JSON.stringify({ Event: 'OnCardInserted' }));
    });
}

function onCardLoadProgress() {
    console.log('onCardLoadProgress');
    wss.clients.forEach(function (client) {
        client.send(JSON.stringify({ Event: 'OnCardLoadProgress' }));
    });
}

function onCardLoadCompleted() {
    console.log('onCardLoadCompleted');
    const cardInfo = document.querySelector('#txtIdCardInfo').textContent;
    const photo = document.querySelector('#txtPhoto').textContent;
    wss.clients.forEach(function (client) {
        client.send(JSON.stringify({
            Event: 'OnCardLoadCompleted',
            PhotoImage: photo,
            Data: btoa(cardInfo)
        }));
    });
}

function onCardRemoved() {
    console.log('onCardRemoved');
    wss.clients.forEach(function (client) {
        client.send(JSON.stringify({ Event: 'OnCardRemoved' }));
    });
}

function onCardLoadError() {
    console.log('onCardLoadError');
    wss.clients.forEach(function (client) {
        client.send(JSON.stringify({ Event: 'OnCardLoadError' }));
    });
}

document.querySelector('#btnStartWebSocket').addEventListener('click', startWebSocket)
document.querySelector('#btnStopWebSocket').addEventListener('click', stopWebSocket)
document.querySelector('#btnOnCardInserted').addEventListener('click', onCardInserted)
document.querySelector('#btnOnCardLoadProgress').addEventListener('click', onCardLoadProgress)
document.querySelector('#btnOnCardLoadCompleted').addEventListener('click', onCardLoadCompleted)
document.querySelector('#btnOnCardRemoved').addEventListener('click', onCardRemoved)
document.querySelector('#btnOnCardLoadError').addEventListener('click', onCardLoadError)
document.querySelector('#txtIdCardInfo').textContent = JSON.stringify(mockIdCardInfo);
document.querySelector('#txtPhoto').textContent = '';